Il articule la conception, les procédures, et les stratégies à mettre en œuvre pour atteindre les résultats escomptés tels que présentés dans le programme-pays. Ainsi il permettra :
•	La mise en place d’un système d’information approprié pour mieux connaître la violence fondée sur le genre;
•	Une meilleure prise en charge spécialisée et diversifiée des femmes survivantes à la Violence Fondée dur Genre ;
•	Le développement d’un plan de plaidoyer en direction des décideurs et planificateurs ;
•	Le renforcement du partenariat avec les ONGs exerçant dans le domaine de la promotion et de l’habilitation de la femme et de la lutte contre les inégalités genre.

